    //Perform the animation
    function animate_lines(line, xpos, ypos, yend, i, timing) {

        var yreset = win_height;

        if (yend > 0) {
            yreset = yend * -1;
        }

        //Restart the animation so it's off screen
        if (i > 1) {
            line.attr({transform: 't' + xpos + ' ' + yreset});
        }

        var ease = mina.easeout;
        if (i < 4) {
            timing = timing / 2;
            ease = mina.easeout
        } else {
            timing = timing * 2;
            ease = mina.easein
        }

        line.stop().animate({transform: 't' + xpos + ' ' + yend}, timing, ease, function () {
            i++;
            if (i < 6) {
                animate_lines(line, xpos, ypos, yend, i, timing)
            } else {
                line.attr({transform: 't' + xpos + ' ' + yreset});
                line.stop().animate({transform: 't' + xpos + ' ' + ypos}, timing);
            }

        });
    }

