    //Draw the lines for the second section below the hero
    //Intro animation system while scrolling landing only
    function drawline() {

        var start_in = win_height * .3;
        var start_out = win_height;

        if (scroll_top >= (start_in - 25) && scroll_top <= (start_out * 2)) {

            var svg_container = document.getElementById("whatwedo");
            var svg_paths = svg_container.getElementsByTagNameNS(ns, "path");
            var svg_lines = svg_container.getElementsByTagNameNS(ns, "line");

            if (scroll_top - start_in < 0) {
                var percent_done = 0;
            } else {
                var percent_done = (scroll_top - start_in) / (start_out - start_in);
            }

            for (var x = 0; x < svg_paths.length; x++) {
                var path = svg_paths[x];
                var path_length = path.getTotalLength();
                var length = percent_done * path_length;

                path.style.strokeDasharray = [length, path_length].join(' ');
                path.style.fillOpacity = percent_done - .4;
            }

            for (var x = 0; x < svg_lines.length; x++) {

                var line = svg_lines[x];
                var line_height = path.getTotalLength();
                var length = percent_done * line_height + 36;

                line.style.strokeOpacity = percent_done;
                line.style.strokeDasharray = [length, path_length].join(' ');
            }
        }
    }








